import React from "react";
import notes from "../notes";

var addedNotes = notes.map(function(item) {
  return item.content;
})

function Note() {
  return (
    <div className="note">
      <h1>This is the note title</h1>
      <p>This is the note content</p>
    </div>
  );
}

export default Note;
